// HomePage.js
import React from "react";
import Header from "../../components/ui/header/header";
import Footer from "../../components/ui/footer/footer";
import TreeView from "./treeView";
function HomePage() {
  return (
    <div>
      <Header />
      <TreeView />
      <Footer />
    </div>
  );
}

export default HomePage;
